export function Sport ({data,del}){
    const element = data.map((el)=>{
        return(
        <div className="Sport-element">
            <div className="Sport-element__item">
                {el.date}
            </div>
            <div className="Sport-element__item">
                {el.distance}
            </div>
            <button className="item-delete" onClick={del}>
                Удалить
            </button>
        </div>)})
    return(
        <div className="sport-window">
            <div>
                {element}
            </div>
        </div>
    )
}
